INSERT INTO `v1_546686ed26bd92507fbb16d53ef1d1fe6b9ddb9368c21fec6be5ae837bcbc6c6` VALUES (1, 0.0, 1, 24, 102601, 0.0, "2030/12/17 14:59:59", 0.0, 0, "2020/04/30 12:00:00", 24001, 10040, "リン", "あたしだって\nやるときはやるよ！");
INSERT INTO `v1_546686ed26bd92507fbb16d53ef1d1fe6b9ddb9368c21fec6be5ae837bcbc6c6` VALUES (1, 0.0, 1, 24, 102601, 0.0, "2030/12/17 14:59:59", 0.0, 1, "2020/04/30 12:00:00", 24002, 10040, "リン", "ふぅ…\nこれであたしの仕事は\n終わりだね");
INSERT INTO `v1_546686ed26bd92507fbb16d53ef1d1fe6b9ddb9368c21fec6be5ae837bcbc6c6` VALUES (1, 0.0, 1, 24, 102601, 0.0, "2030/12/17 14:59:59", 0.0, 2, "2020/04/30 12:00:00", 24003, 10040, "リン", "終わった終わった\n一人でもなんとか\nなるもんだね");
INSERT INTO `v1_546686ed26bd92507fbb16d53ef1d1fe6b9ddb9368c21fec6be5ae837bcbc6c6` VALUES (2, 0.0, 2, 24, 102601, 0.0, "2030/12/17 14:59:59", 0.0, 3, "2020/04/30 12:00:00", 24004, 10040, "リン", "やったね！\nこれでようやく\nサボれるよ…");
INSERT INTO `v1_546686ed26bd92507fbb16d53ef1d1fe6b9ddb9368c21fec6be5ae837bcbc6c6` VALUES (1, 0.0, 1, 24, 102601, 0.0, "2030/12/17 14:59:59", 0.0, 4, "2020/04/30 12:00:00", 24005, 10040, "リン", "チーズが欲しいなら\nきちんと働いて\n買いに来なよ");
INSERT INTO `v1_546686ed26bd92507fbb16d53ef1d1fe6b9ddb9368c21fec6be5ae837bcbc6c6` VALUES (2, 0.0, 2, 24, 102601, 0.0, "2030/12/17 14:59:59", 0.0, 5, "2020/04/30 12:00:00", 24006, 10040, "リン", "あたしを敵に回した\n恐ろしさ\n思い知ったか！");
INSERT INTO `v1_546686ed26bd92507fbb16d53ef1d1fe6b9ddb9368c21fec6be5ae837bcbc6c6` VALUES (2, 0.0, 2, 24, 102601, 0.0, "2030/12/17 14:59:59", 0.0, 6, "2020/04/30 12:00:00", 24007, 10040, "リン", "あたしも意外と\nやるもんでしょ？");
INSERT INTO `v1_546686ed26bd92507fbb16d53ef1d1fe6b9ddb9368c21fec6be5ae837bcbc6c6` VALUES (4, 0.0, 4, 24, 102601, 0.0, "2030/12/17 14:59:59", 0.0, 7, "2020/04/30 12:00:00", 24008, 10040, "リン", "疲れた…\nねずみの逃げ足\n速すぎるよ…");
INSERT INTO `v1_546686ed26bd92507fbb16d53ef1d1fe6b9ddb9368c21fec6be5ae837bcbc6c6` VALUES (4, 0.0, 4, 24, 102601, 0.0, "2030/12/17 14:59:59", 0.0, 8, "2020/04/30 12:00:00", 24009, 10040, "リン", "このままじゃ\nまっひ～に\n叱られちゃうよ");
INSERT INTO `v1_546686ed26bd92507fbb16d53ef1d1fe6b9ddb9368c21fec6be5ae837bcbc6c6` VALUES (4, 0.0, 4, 24, 102601, 0.0, "2030/12/17 14:59:59", 0.0, 9, "2020/04/30 12:00:00", 24010, 10040, "リン", "まじめに\nやったんだけどな…\n悔しいな～");
INSERT INTO `v1_546686ed26bd92507fbb16d53ef1d1fe6b9ddb9368c21fec6be5ae837bcbc6c6` VALUES (4, 0.0, 4, 24, 102601, 0.0, "2030/12/17 14:59:59", 0.0, 10, "2020/04/30 12:00:00", 24011, 10040, "リン", "やられた…\nねずみって意外と\nてごわいね");
INSERT INTO `v1_546686ed26bd92507fbb16d53ef1d1fe6b9ddb9368c21fec6be5ae837bcbc6c6` VALUES (4, 0.0, 4, 24, 102601, 0.0, "2030/12/17 14:59:59", 0.0, 11, "2020/04/30 12:00:00", 24012, 10040, "リン", "おのれ～\nあたしのチーズを\n盗みやがって～！");
INSERT INTO `v1_546686ed26bd92507fbb16d53ef1d1fe6b9ddb9368c21fec6be5ae837bcbc6c6` VALUES (4, 1.81, 1, 24, 102601, 0.0, "2030/12/17 14:59:59", 0.0, 12, "2020/04/30 12:00:00", 24013, 10040, "リン", "疲れた…\nけど、次こそは\n守り抜くよ…");
